// https://developer.spotify.com/
// documentation/web-playback-sdk/quick-start/#

export const authEndKey =
    "https://accounts.spotify.com/authorize";

const redirectUri = "http://localhost:3000/";
const clientId = "29bfd7ff859d48eb8fa785f8657abcac";
const scopes = [
    "user-read-currently-playing",
    "user-read-recently-played",
    "user-read-playback-state",
    "user-top-read",
    "user-modify-playback-state",
];
export const loginUrl = `${authEndKey}?client_id=${clientId}&redirect_uri=${redirectUri}&scoppe=${scopes.join("%20")}&response_type=token&show_dialog=true`;
